var createTable = function (rows) {
    var body = [];
    var headers = [];
    var widths = [];
    widths.push(100);
    rows[0].questions.forEach(function (question) {
        headers.push({ text: question.definitionTranslationCode, style: 'dateText' });
        widths.push(220);
    });
    body.push(headers);
    rows.forEach(function (journal) {
        var answers = [];
        journal.questions.forEach(function (question) {
            switch (question.type) {
                case 'AR': {
                    var answer_1 = { ul: [], style: 'answerText', margins: [0, 4, 8, 4] };
                    var questionAnswer_1 = JSON.parse(question.answer);
                    questionAnswer_1.forEach(function (answerItem) {
                        answer_1.ul.push({ text: answerItem });
                    });
                    answers.push(answer_1);
                    break;
                }
                case 'TE':
                    answers.push({
                        text: JSON.parse(question.answer),
                        style: 'answerText',
                        margins: [0, 4, 8, 4]
                    });
                    break;
                case 'BS': {
                    var answer_2 = { ul: [], style: 'answerText', margins: [0, 4, 8, 4] };
                    _.forIn(JSON.parse(question.answer), function (value, bodyPart) {
                        var feelingList = '';
                        value.forEach(function (feeling) {
                            feelingList = feelingList.concat(t(feeling) + ", ");
                        });
                        if (feelingList.length > 0) {
                            feelingList = feelingList.substring(0, feelingList.length - 2);
                            answer_2.ul.push({ text: t(bodyPart) + ": " + feelingList });
                        }
                    });
                    answers.push(answer_2);
                    break;
                }
                case 'CS':
                    var numericValue = void 0;
                    var questionAnswer = JSON.parse(question.answer);
                    var image1 = smilie1_20;
                    var image2 = smilie2_20;
                    var image3 = smilie3_20;
                    var image4 = smilie4_20;
                    var image5 = smilie5_20;
                    if (questionAnswer < 8.3) {
                        image1 = smilie1_100;
                    }
                    else if (questionAnswer < 16.6) {
                        image1 = smilie1_75;
                        image2 = smilie2_75;
                    }
                    else if (questionAnswer < 33.3) {
                        image2 = smilie2_100;
                    }
                    else if (questionAnswer < 41.6) {
                        image2 = smilie2_75;
                        image3 = smilie3_75;
                    }
                    else if (questionAnswer < 58.3) {
                        image3 = smilie3_100;
                    }
                    else if (questionAnswer < 66.6) {
                        image3 = smilie3_75;
                        image4 = smilie4_75;
                    }
                    else if (questionAnswer < 83.3) {
                        image4 = smilie4_100;
                    }
                    else if (questionAnswer < 91.6) {
                        image5 = smilie5_75;
                        image5 = smilie5_75;
                    }
                    else {
                        image5 = smilie5_100;
                    }
                    answers.push({
                        stack: [
                            {
                                table: {
                                    widths: [100],
                                    body: [
                                        [{
                                                fillColor: '#d9d9d9',
                                                style: 'timeView',
                                                text: [
                                                    {
                                                        text: moment(journal.sessionDate, 'DD-MM-YYYY HH:mm').format('dd').toUpperCase() + " ",
                                                        style: 'timeText',
                                                    },
                                                    {
                                                        text: moment(journal.sessionDate, 'DD-MM-YYYY HH:mm').format('DD/MM') + " ",
                                                        style: 'timeTextSmall',
                                                    },
                                                    {
                                                        text: " - " + moment(journal.sessionDate, 'DD-MM-YYYY HH:mm').format('HH:mm'),
                                                        style: 'timeText',
                                                    },
                                                ],
                                            }]
                                    ],
                                },
                                layout: 'noBorders',
                            },
                            {
                                canvas: [
                                    {
                                        type: 'rect',
                                        x: 10,
                                        y: 10,
                                        w: 80,
                                        h: 2,
                                        r: 2,
                                        lineWidth: 0,
                                        color: '#d9d9d9',
                                    },
                                    {
                                        type: 'rect',
                                        x: 10,
                                        y: 10,
                                        w: ((80 / 100) * questionAnswer),
                                        h: 2,
                                        r: 2,
                                        // lineWidth: 10,
                                        color: '#ff0066',
                                    },
                                ],
                            },
                            {
                                columns: [
                                    {
                                        margin: [10, 4, 0, 8],
                                        width: 100,
                                        columns: [
                                            {
                                                image: image1,
                                                fit: [9, 9],
                                            },
                                            {
                                                image: image2,
                                                fit: [9, 9],
                                            },
                                            {
                                                image: image3,
                                                fit: [9, 9],
                                            },
                                            {
                                                image: image4,
                                                fit: [9, 9],
                                            },
                                            {
                                                image: image5,
                                                fit: [9, 9],
                                            }
                                        ],
                                    }
                                ]
                            },
                        ],
                    });
                    break;
                case 'RB': {
                    var questionOption = _.find(question.options, { questionOptionId: JSON.parse(question.answer) });
                    answers.push({
                        text: questionOption.optionTranslationCode,
                        style: 'answerText',
                        margins: [8, 4, 8, 4]
                    });
                    break;
                }
                case 'CB': {
                    var answer_3 = { ul: [], style: 'answerText', margins: [8, 4, 8, 4] };
                    var questionAnswer_2 = JSON.parse(question.answer);
                    questionAnswer_2.forEach(function (option) {
                        var questionOption = _.find(question.options, { questionOptionId: option });
                        answer_3.ul.push({ text: questionOption.optionTranslationCode });
                    });
                    answers.push(answer_3);
                    break;
                }
                default:
            }
        });
        body.push(answers);
    });
    return {
        style: {
            margin: [16, 0, 0, 0],
        },
        table: {
            dontBreakRows: true,
            headerRows: 1,
            widths: widths,
            body: body,
        },
        layout: {
            paddingLeft: function (i, node) {
                return (i === 0) ? 0 : 4;
            },
            paddingTop: function (i, node) {
                return 0;
            },
            paddingRight: function (i, node) {
                return (i === 0) ? 0 : 4;
            },
            hLineColor: function (i, node) {
                return '#d9d9d9';
            },
            vLineColor: function (i, node) {
                return '#d9d9d9';
            },
        }
    };
};
